import React, {Component} from 'react';
import "./welcome.css";

class Welcome extends Component {
    render () {
        return (
            <div className="container">
                <div className="title">
                    <h1>Discover and Play</h1>
                </div>
            </div>
        );
    }
}

export default Welcome;
